import React, { useContext, useEffect } from 'react'
import { storeContext } from '../../App';


function Home() {
  const { store } = useContext(storeContext);
  useEffect(() => {
      console.log(store);
  },[store]);


  return (
    <div>
      Home
    </div>
  )
}

export default Home;
